-- Bicicletas 21-241 - Patrón cíclico
DECLARE @bici INT = 21;
DECLARE @tarifa_base_ciclo DECIMAL(10,2);
DECLARE @tipo_ciclo INT;
DECLARE @admin_ciclo INT;
DECLARE @plan_ciclo INT;
DECLARE @valor_ciclo DECIMAL(10,2);

WHILE @bici <= 241
BEGIN
    SET @tipo_ciclo = (@bici - 1) % 5;
    SET @admin_ciclo = ((@bici - 1) % 20) + 1;
    
    -- Seleccionar tarifa base según tipo
    SELECT @tarifa_base_ciclo = CASE @tipo_ciclo
        WHEN 0 THEN 8000.00
        WHEN 1 THEN 12000.00
        WHEN 2 THEN 15000.00
        WHEN 3 THEN 20000.00
        ELSE 25000.00
    END;
    
    -- Insertar 4 tarifas (un plan cada una)
    SET @plan_ciclo = 1;
    WHILE @plan_ciclo <= 4
    BEGIN
        SELECT @valor_ciclo = CASE @plan_ciclo
            WHEN 1 THEN @tarifa_base_ciclo * 1.00
            WHEN 2 THEN @tarifa_base_ciclo * 10.00
            WHEN 3 THEN @tarifa_base_ciclo * 50.00
            ELSE @tarifa_base_ciclo * 120.00
        END;
        
        VALUES (@plan_ciclo, @bici, '2025-11-12', @valor_ciclo, 'COP', @admin_ciclo);
        
        SET @plan_ciclo = @plan_ciclo + 1;
    END;
    
    SET @bici = @bici + 1;
END;

PRINT '';
PRINT '========================================';
PRINT 'TARIFAS COMPLETADAS - HISTORIA 6';
